import React from 'react';
import ReactDOM from 'react-dom/client';
import './css/index.css';
import App from './App';

import { LogsContextProvider } from './context/LogsContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <LogsContextProvider>
      <App />
    </LogsContextProvider>

  </React.StrictMode>
);
